import './App.css';
function App() {
  return (
    <div className="App">
      <header className="header">

          <div className='container'>
            <ul className="nav navbar-nav visible-xs visible-sm">
            <li className="dropdown active"><a href="http://localhost:3000/">
                  <img src="juejin.svg" alt="掘金" />
                </a>  
            </li>
            <li>
              <div className='menu'>
                <span>首页</span>
              </div>
            </li>
            </ul>
          </div>



      </header>
    </div>
  );
}

export default App;
